import React, { useState } from "react";
import axios from "axios";

const HabibData = () => {
  const [chooseClinic, setChooseClinic] = useState("Choose Clinic");
  const [allDoctors, setAllDoctors] = useState([]);
  const [doctorAvailableTimes, setDoctorAvailableTimes] = useState([]);

  const choosedClinic = (event) => {
    const innerText = event.target.innerText;
    setChooseClinic(innerText);

    // IM
    axios
      .get("http://localhost:3001/habibUrl/habibSchedule")
      .then((response) => {
        console.log(response.data);
        setAllDoctors(response.data);
      });
  };

  // useEffect(() => {
  //   // if (localStorage.getItem("accessToken")) {
  //   axios
  //     .get("http://localhost:3001/auth/auth", {
  //       headers: { accessToken: localStorage.getItem("accessToken") },
  //     })
  //     .then((response) => {
  //       if (response.data.error) {
  //         setAuthState({ ...authState, status: false }); // Grabbing the ...authState and change only the status to false.
  //       } else {
  //         setAuthState({
  //           username: response.data.username,
  //           id: response.data.id,
  //           status: true,
  //         });
  //       }
  //     });
  //   }

  return (
    <div style={{ maxWidth: "260px", justifyContent: "center" }}>
      <div className="habibPageContainer">
        {/* <div className="basicInfo"></div> */}
        <div className="column">
          <div className="dropdown">
            <button className="dropbtn2">{chooseClinic}</button>
            <div className="dropdown-content">
              <a href="#" onClick={choosedClinic}>
                Cardiology
              </a>
              <a href="#" onClick={choosedClinic}>
                Internal Medicine
              </a>
              <a href="#" onClick={choosedClinic}>
                Endocrinology
              </a>
              <a href="#" onClick={choosedClinic}>
                Family Medicine
              </a>
            </div>
          </div>
        </div>
      </div>

      {/* List Of Doctors */}

      <div className="column">
        {allDoctors.map((doctor, key) => {
          return (
            <div>
              <img src={`${doctor.Img}`}></img>
              <h4>
                {key + 1}- {doctor.Name}
              </h4>
              {/* <h5>{doctor.Speciality}</h5> */}
              <h4>Date: {doctor.Date}</h4>
              {/* <p>Times:{doctor.Times[0]}</p> */}
              <p style={{ fontWeight: "bold" }}>
                Times :
                {doctor.Times.map((time, id) => (
                  <p
                    style={{ display: "inline-block", marginRight: "10px" }}
                    key={id}
                  >
                    {time}
                  </p>
                ))}
              </p>
            </div>
          );
        })}
      </div>

      <div className="listOfAppointments"></div>
    </div>
  );
};

export default HabibData;
